  "중세미술",
  "근세미술",
  "근대미술",
  "현대미술",
];
const artMovement = [];
const genre = [
  "추상",
  "인물",
  "풍경",
  "스케치",
  "조각",
  "미디어 아트",
  "사진",
  "설치미술",
];
const takePhoto = ["사진촬영 가능"];

function HashTag() {
  return (
    <Paper
      sx={{
        backgroundColor: "Red", //#1b1b1b
        minWidth: "360px",
        paddingBottom: "10px",
        paddingTop: "60px",
      }}
    ></Paper>
  );
}

export default HashTag;
